import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png";
import Dropdown from "../commonwallpaper/Dropdown";
import "./SignUp";

function SignUp() {
  return (
    <div
      className=" flex absolute bg-black bg-opacity-100 overflow-hidden"
      style={{ backgroundColor: "#000" }}
    >
      <div className="logo-container">
        <img
          class="h-auto max-w-xs"
          className="img-logo"
          src={netflixlogo}
          alt="netflix-logo"
          style={{ color: "red" }}
        />

        <div  class="relative w-24"
        data-te-dropdown-position="dropstart"
       >
          <span>  <Dropdown /> </span>

        </div>
      </div>
      <div>
        <Wallpaper />
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
}

export default SignUp;
